import React from 'react';
import styled from 'styled-components';

//
import image1 from '../images/the-chow-one.png'
const Instagram = () => {

    const Container = styled.div`
        grid-template-columns: 100px 50px 100px;
        grid-template-rows: 80px auto 80px; 
        column-gap: 10px;
        row-gap: 15px;
        justify-content: end;
    `
    const ItemOne = styled.div`

        grid-column-start: 1;
        grid-column-end: 9;
        grid-row-start: 1;
        grid-row-end: 6;

    `
    const ItemTwo = styled.div`

        grid-column-start: 1;
        grid-column-end: 6;
        grid-row-start: 6;
        grid-row-end: 12;

    `
    const ItemThree = styled.div`

        grid-column-start: 6;
        grid-column-end: 9;
        grid-row-start: 6;
        grid-row-end: 9;

    `
    const ItemFour = styled.div`

        grid-column-start: 6;
        grid-column-end: 9;
        grid-row-start: 9;
        grid-row-end: 12;

    `

    return (
        <Container>

            <ItemOne>
                <img style={{width: '100%'}} src={image1} alt=""/>
            </ItemOne>

            <div>
                <img style={{width: '100%'}} src={ItemTwo} alt=""/>
            </div>

            <div>
                <img style={{width: '100%'}} src="../img/cater-gallery-img/party-reception.jpg" alt=""/>
            </div>

            <div>
                <img style={{width: '100%'}} src={"../img/cater-gallery-img/graduation-ceremony.jpg"} alt=""/>
            </div>

      </Container>
    )
}

export default Instagram;
